import React, { PureComponent } from 'react';
import { Dimensions, FlatList, Image, View, Pressable } from 'react-native';

const _UploadImagesGrid = () => {
    return (
        <View
            style={{ paddingTop: 1, paddingHorizontal: 0.5 }}>
            <FlatList
                numColumns={3}
                keyboardShouldPersistTaps="handled"
            />
        </View>
    )
}

const styles = {
    exptyStateText: {
        textAlign: 'center',
        marginTop: 20,
        paddingHorizontal: 20
    },
    checkCircleContainer: {
        position: 'absolute',
        width: 24,
        height: 24,
        backgroundColor: '#0984e3',
        right: 10,
        bottom: 10,
        borderRadius: 100,
        justifyContent: 'center',
        alignItems: 'center'
    }
};

export default _UploadImagesGrid;
